function map_gis_utp($self) {
	$shapes=__map_gis_utp_data();

	//$ret=$shapes['Utapao'];

	foreach ($shapes as $key=>$shape) {
		foreach (explode(" ",$shape) as $item) {
			list($lat,$lng)=explode(',',$item);
			$lat=floatval($lat);
			$lng=floatval($lng);
			$ret[$key][]=array($lng,$lat);
		}
	}
	//		echo json_encode($ret);
	//echo $shape;
	//		print_o($ret,'$ret',1);
	return $ret;
}

